import React, { useState } from "react";
import "./Doctordashboard.css";

const Doctordashboard = () => {
  const [activeTab, setActiveTab] = useState("dashboard");
  const [profileData, setProfileData] = useState(null);
  const [availabilityList, setAvailabilityList] = useState([]);
  const [profileFormData, setProfileFormData] = useState({
    name: "",
    specialization: "",
    experience: "",
    profilePhoto: null,
  });
  const [availabilityFormData, setAvailabilityFormData] = useState({
    fromDate: "",
    toDate: "",
    timeSlot: "",
  });

  const handleLogout = () => {
    alert("Logged out successfully!");
    window.location.href = "/login"; // Redirect to login page
  };

  const handleProfileFormChange = (e) => {
    const { name, value } = e.target;
    if (name === "profilePhoto") {
      setProfileFormData({ ...profileFormData, profilePhoto: e.target.files[0] });
    } else {
      setProfileFormData({ ...profileFormData, [name]: value });
    }
  };

  const handleAvailabilityFormChange = (e) => {
    const { name, value } = e.target;
    setAvailabilityFormData({ ...availabilityFormData, [name]: value });
  };

  const handleProfileSubmit = (e) => {
    e.preventDefault();
    setProfileData(profileFormData);
    setActiveTab("profile"); // Switch to viewing the profile
    alert("Profile updated successfully!");
  };

  const handleAddAvailabilitySubmit = (e) => {
    e.preventDefault();
    setAvailabilityList([...availabilityList, availabilityFormData]);
    setAvailabilityFormData({ fromDate: "", toDate: "", timeSlot: "" });
    alert("Availability added successfully!");
  };

  const handleEditProfile = () => {
    setActiveTab("profileForm");
  };

  const handleDeleteProfile = () => {
    if (window.confirm("Are you sure you want to delete your profile?")) {
      setProfileData(null);
      alert("Profile deleted successfully!");
    }
  };

  const handleEditAvailability = (index) => {
    setAvailabilityFormData(availabilityList[index]);
    setAvailabilityList((prev) =>
      prev.filter((_, i) => i !== index)
    ); // Remove existing entry to avoid duplication
    setActiveTab("availabilityForm");
  };

  const handleDeleteAvailability = (index) => {
    if (window.confirm("Are you sure you want to delete this availability?")) {
      setAvailabilityList(availabilityList.filter((_, i) => i !== index));
      alert("Availability deleted successfully!");
    }
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>Doctor Dashboard</h2>
        <button onClick={() => setActiveTab("dashboard")}>Dashboard</button>
        <button onClick={() => setActiveTab("profile")}>Profile</button>
        <button onClick={() => setActiveTab("availability")}>Availability</button>
        <button onClick={() => setActiveTab("appointments")}>Appointments</button>
        <button onClick={() => setActiveTab("patients")}>Patients</button>
        <button onClick={() => setActiveTab("chat")}>Chat</button>
        <button onClick={() => setActiveTab("settings")}>Settings</button>
        <button className="logout-button" onClick={handleLogout}>
          Logout
        </button>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {activeTab === "dashboard" && (
          <div>
            <h1>Welcome to Doctor Dashboard</h1>
            {/* Add content for dashboard like profile overview, charts, etc. */}
          </div>
        )}

        {activeTab === "profile" && profileData && (
          <div>
            <h2>Doctor Profile</h2>
            <p><strong>Name:</strong> {profileData.name}</p>
            <p><strong>Specialization:</strong> {profileData.specialization}</p>
            <p><strong>Experience:</strong> {profileData.experience} years</p>
            {profileData.profilePhoto && (
              <img
                src={URL.createObjectURL(profileData.profilePhoto)}
                alt="Profile"
                style={{ width: "150px", borderRadius: "50%" }}
              />
            )}
          </div>
        )}

        {activeTab === "profileForm" && (
          <div>
            <form onSubmit={handleProfileSubmit}>
              <h2>Edit Profile</h2>
              <input
                type="text"
                name="name"
                placeholder="Name"
                value={profileFormData.name}
                onChange={handleProfileFormChange}
                required
              />
              <input
                type="text"
                name="specialization"
                placeholder="Specialization"
                value={profileFormData.specialization}
                onChange={handleProfileFormChange}
                required
              />
              <input
                type="number"
                name="experience"
                placeholder="Experience"
                value={profileFormData.experience}
                onChange={handleProfileFormChange}
                required
              />
              <input
                type="file"
                name="profilePhoto"
                onChange={handleProfileFormChange}
                required
              />
              <button type="submit">Save Changes</button>
            </form>
          </div>
        )}

        {activeTab === "availability" && (
          <div>
            <h2>Doctor Availability</h2>
            {availabilityList.map((availability, index) => (
              <div key={index}>
                <p>
                  <strong>From:</strong> {availability.fromDate} - <strong>To:</strong>{" "}
                  {availability.toDate}
                </p>
                <p>
                  <strong>Time Slot:</strong> {availability.timeSlot}
                </p>
                <button onClick={() => handleEditAvailability(index)}>Edit</button>
                <button onClick={() => handleDeleteAvailability(index)}>Delete</button>
              </div>
            ))}
            <form onSubmit={handleAddAvailabilitySubmit}>
              <input
                type="date"
                name="fromDate"
                placeholder="From Date"
                value={availabilityFormData.fromDate}
                onChange={handleAvailabilityFormChange}
                required
              />
              <input
                type="date"
                name="toDate"
                placeholder="To Date"
                value={availabilityFormData.toDate}
                onChange={handleAvailabilityFormChange}
                required
              />
              <input
                type="time"
                name="timeSlot"
                placeholder="Time Slot"
                value={availabilityFormData.timeSlot}
                onChange={handleAvailabilityFormChange}
                required
              />
              <button type="submit">Add Availability</button>
            </form>
          </div>
        )}
      </div>
    </div>
  );
};

export default Doctordashboard;
